import React, { useState } from "react";
import icons from "../ultis/icon";
const SidebarRight = () => {
  const {TfiAlarmClock, FiMoreHorizontal} = icons
  const [active, setactive] = useState(false);
  return (
    <div className="h-screen bg-sidebar-rigth w-full flex flex-col text-xs animate-slide-left text-[#ddd] ">
      <div className="h-[70px] flex border border-red-500 items-center px-2 ">
        <div className="flex rounded-full  py-[1px] px-[1px] bg-main-100 items-center ">
          <span className={`px-3 py-[6px]  rounded-full text-md ${!active && 'bg-active'}`}>Danh sách phát </span>
          <span className="px-3 py-[6px]  rounded-full text-md"  >Nghe gần đây </span>
        </div>
        <span className="p-2 rounded-full"><TfiAlarmClock size={20}/></span>
        <span className="p-2 rounded-full"><FiMoreHorizontal size={20}/></span>

      </div>
      <div className="">contend</div>

    </div>
  );
};

export default SidebarRight;
